import logo from './logo.svg';
import './App.css';
import {Heading, Icon} from 'react-bulma-components';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faEllipsisV, faSlidersH } from '@fortawesome/free-solid-svg-icons';
import { useState, useEffect } from 'react';
import 'bulma/css/bulma.min.css';
import React from 'react';


function Header(props) {
  const style = {
    "paddingTop": "100px"
  }

  return (
    <div>
      <p style={style} className="title is-1">Gym Cal</p>
      <hr/>
    </div>
    );
}

function DayCard(props) {
  return (
    <div className="column">
      <div className="card">
        <header className="card-header">
          <p className="card-header-title">
            Card header
          </p>
          <button className="card-header-icon" aria-label="more options">
            <span className="icon">
              <i className="fas fa-angle-down" aria-hidden="true"></i>
            </span>
          </button>
        </header>
      </div>
    </div>
    );
}

class WeekRow extends React.Component {
  render() {
    return (
        <div className="columns">
          {this.props.days.map((value, index) => {DayCard()})}
        </div>
      )
  }
}

class Calendar extends React.Component {
  render () {
    return (
      <WeekRow days={[1,2,3,4,5,6,7]}/>
    );
  }
}

function App() {
  return (
    <div className="App">
      <div className="container">
        {Header()}
        {<Calendar/>}
      </div>
    </div>
  );
}

export default App;
